// Generated by LiveScript 1.3.1
var module = {};
module.exports = plotdb.chart.create({
  name: 'pie',
  title: "Pie Chart",
  desc: "A simple responsive pie chart",
  author: "Kirby Wu",
  sample: [
    { value: 1, text: 1, name: "IE" }, 
    { value: 7, text: 7, name: "Chrome"},
    { value: 5, text: 5, name: "Firefox"},
    { value: 2, text: 2, name: "Opera"},
    { value: 4, text: 4, name: "Android"},
    { value: 2, text: 2, name: "Safari" },
    { value: 1, text: 1, name: "Puffin" }
  ],
  dimension: {
    value: { type: [plotdb.Number], require: true },
    name: { type: [], require: false },
    text: { type: [], require: false }
  },
  config: {
    padding: { type: [plotdb.Number, plotdb.Percent], 'default': 10 },
    margin: { type: [plotdb.Number, plotdb.Percent], 'default': 10 },
    radius: { type: [plotdb.Number], 'default': 5 },
    palette: { type: [plotdb.Palette], 'default': plotdb.Palette['default'] },
    fontSize: { type: [plotdb.Number], 'default': 12 },
    showLabel: { type: [plotdb.Boolean], 'default': true },
    labelOutside: { type: [plotdb.Boolean], 'default': true },
    ringMode: { type: [plotdb.Boolean], 'default': false }
  },
  init: function(){
    this.svg = d3.select(this.root).append('svg');
    this.g = this.svg.append('g');
    return this.gLegend = this.svg.append('g');
  },
  bind: function(){
    var sum, x$, y$, z$, z1$;
    var root = this.root, config = this.config, data = this.data;
    this.pie = d3.layout.pie().value(function(it){
      return it.value;
    }).padAngle(0.00);
    sum = data.map(function(it){
      return parseFloat(it.value);
    }).reduce(function(a, b){
      return a + b;
    }, 0);
    data.map(function(it){
      return it.percent = parseInt(1000 * it.value / sum) / 10 + "%";
    });
    this.data = this.pie(data);
    x$ = this.g.selectAll('path.wedge').data(this.data);
    x$.enter().append('path').attr({
      'class': 'wedge'
    });
    x$.exit().remove();
    y$ = this.g.selectAll('text.value').data(this.data);
    y$.enter().append('text').attr({
      'class': 'value'
    });
    z$ = this.gLegend.selectAll('rect.legend').data(this.data);
    z$.enter().append('rect').attr({
      'class': 'legend'
    });
    z1$ = this.gLegend.selectAll('text.legend').data(this.data);
    z1$.enter().append('text').attr({
      'class': 'legend'
    });
    return z1$;
  },
  resize: function(){
    var ref$, w, h, m, p, f, this$ = this;
    var root = this.root, config = this.config, data = this.data;
    ref$ = [$(root).width(), $(root).height()], w = ref$[0], h = ref$[1];
    ref$ = [config.margin, config.padding, config.fontSize], m = ref$[0], p = ref$[1], f = ref$[2];
    this.w = w;
    this.h = h;
    this.m = m;
    this.legendWidth = f * d3.max(this.data.map(function(it){
      return (it.name || "").length;
    }).concat([1])) + 10;
    w = w - this.legendWidth - this.m;
    this.mw = w > h ? h : w;
    this.size = this.mw / 2 - m - (config.labelOutside ? f * 3 : 0);
    this.offset = this.size + this.m + (config.labelOutside ? f * 3 : 0);
    this.color = d3.scale.ordinal().range(config.palette.colors.map(function(it){return it.hex;}));
    this.radius = config.radius;
    this.arc = d3.svg.arc().outerRadius(this.size).innerRadius(config.ringMode ? this.size * 0.7 : 0);
    return this.data.map(function(it){
      return it.cv = this$.nvector(this$.arc.centroid(it));
    });
  },
  nvector: function(v){
    var len;
    len = Math.sqrt(Math.pow(v[0], 2) + Math.pow(v[1], 2));
    return [v[0] / len, v[1] / len];
  },
  render: function(){
    var x$, rate, y$, z$, z1$, this$ = this;
    var root = this.root, config = this.config, data = this.data;
    this.svg.attr({
      width: this.w,
      height: this.h,
      viewBox: "0 0 " + this.mw + " " + this.mw,
      preserveAspectRatio: "xMidYMid"
    });
    this.g.attr({
      transform: "translate(" + this.offset + "," + this.offset + ")"
    });
    x$ = this.g.selectAll('path.wedge');
    x$.attr({
      d: this.arc,
      fill: function(it){
        return this$.color(it.data.name);
      }
    });
    if (config.labelOutside) {
      rate = this.size + config.fontSize * 1.5;
    } else if (config.ringMode) {
      rate = this.size * 0.85;
    } else {
      rate = this.size * 0.8;
    }
    y$ = this.g.selectAll('text.value');
    y$.attr({
      x: function(it){
        return this$.nvector(this$.arc.centroid(it))[0] * rate;
      },
      y: function(it){
        return this$.nvector(this$.arc.centroid(it))[1] * rate;
      },
      "text-anchor": 'middle',
      opacity: function(){
        if (config.showLabel) {
          return 1;
        } else {
          return 0;
        }
      }
    });
    y$.text(function(it){
      return it.data.percent;
    });
    if (!config.labelOutside) {
      this.g.selectAll('text.value').attr({
        fill: function(it){
          if (d3.hsl(this$.color(it.data.name)).l > 0.5) {
            return '#222';
          } else {
            return '#fff';
          }
        }
      });
    }
    this.gLegend.attr({
      transform: "translate(" + 2 * (this.size + this.m + (config.labelOutside ? config.fontSize * 3 : 0)) + "," + (this.size + this.m - 0.75 * config.fontSize * this.data.length) + ")"
    });
    z$ = this.gLegend.selectAll('rect.legend');
    z$.attr({
      x: 0,
      y: function(d, i){
        return i * config.fontSize * 1.5;
      },
      width: config.fontSize,
      height: config.fontSize,
      rx: 3,
      ry: 3,
      fill: function(it){
        return this$.color(it.data.name);
      }
    });
    z1$ = this.gLegend.selectAll('text.legend');
    z1$.attr({
      x: function(){
        return 1.5 * config.fontSize;
      },
      y: function(d, i){
        return i * config.fontSize * 1.5;
      },
      "text-anchor": 'start',
      "dominant-baseline": 'hanging'
    });
    z1$.text(function(it){
      return it.data.name;
    });
    return z1$;
  }
});
